import './App.css';
import FreeCodeCamp_Logo from './images/fcc_primary_large.jpg'

function App() {
  return (
    <div className="task-app">
      <div className='freecode_camp_logo'>
        <img
          src={FreeCodeCamp_Logo} //5.36
          className='freecode_camp' />
      </div>
    </div>
  );
}

export default App;
